INSERT INTO `room_types` (`id`, `room_type_name`, `price`, `description`, `photo`, `facilities`, `createdAt`, `updatedAt`) VALUES
(1, 'Standard Room', 75, 'A basic room with comfortable bed and amenities. Enjoy a cozy and comfortable stay in our Standard Room, featuring a plush queen-sized bed, modern amenities, and a sleek bathroom. ', 'standard_room.jpg', 'TV,Air conditioning,Refrigerator,Wi-Fi,Balcony', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(2, 'Deluxe Room', 100, 'Elevate your stay in our Deluxe Room, which includes all the amenities of our Standard Room, plus additional luxuries such as a king-sized bed, premium toiletries, and a mini fridge stocked with snacks and refreshments.', 'deluxe_room.jpg', 'TV,Air conditioning,Refrigerator,Wi-Fi,Balcony,Garden View', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(3, 'Suite Room', 150, 'Indulge in the spacious and upgraded amenities of our Suite Room, which features a separate living area with a flat-screen TV, a king-sized bed, a large bathroom with a luxurious bathtub, and stunning views of the city', 'suite_room.jpg', 'TV,Air conditioning,Refrigerator,Wi-Fi,Balcony,City view,Breakfast', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(4, 'Executive Room', 125, 'Our Executive Room is designed to cater to the needs of business travelers, with features such as an ergonomic workspace, high-speed Wi-Fi, a king-sized bed with luxury linens, and a Nespresso machine for your morning coffee fix.', 'executive_room.jpg', 'TV,Air conditioning,Refrigerator,Wi-Fi,Balcony,City view,Breakfast,Bathrobe & Slippers', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(5, 'Presidential Suite', 300, 'The epitome of luxury and exclusivity, our Presidential Suite features a grand living area, a master bedroom with a king-sized bed, a private balcony with breathtaking views of the city, and a personal butler to cater to your every need.', 'presidential_suite.jpg', 'TV,Air conditioning,Refrigerator,Wi-Fi,Balcony,City view,Breakfast,Bathrobe & Slippers,Twin Bed', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(6, 'Family Room', 150, 'A room designed for families with added space and amenities for families. Our spacious and family-friendly room features two queen-sized beds, a mini-fridge, a microwave, and a flat-screen TV with premium channels', 'family_room.jpg', 'WiFi,TV,Air conditioning,Private bathroom,Balcony,Family Sofa,Desk,Baby bathub', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(7, 'Studio Room', 90, 'A room with a compact living area and kitchenette. Our Studio Room is perfect for longer stays and guests who desire added space and functionality. In addition to a cozy living area and kitchenette, the room features a queen-sized bed and an ergonomic workspace.', 'studio_room.jpg', 'Kitchenette,Wi-Fi,Washing machine,Dryer,Ironing board,Work desk,Sitting area,Soundproofing,Black-out curtains', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(8, 'VIP Room', 200, 'A room with VIP level amenities and services. Treat yourself to the ultimate in luxury and personalized service with our VIP Room, featuring high-end amenities such as a king-sized bed with luxury linens, a personal butler, and exclusive access to our VIP lounge', 'vip_room.jpg', 'Large-size bed,Wi-Fi,Air Conditioner,Balcony,Pool,Mini bar,24/7 room service,Bathrobe,Slippers', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(9, 'Venue Room', 400, 'A venue room is a space designed for events, meetings, and gatherings. It offers a flexible and convenient solution for businesses and individuals who require a professional environment for their events. The venue room features modern furnishings and state-of-the-art technology.', 'venue_room.png', 'Audiovisual equipment,Stage lighting,Projector,Sound system,Podium,Microphones,Wi-Fi', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(10, '', 0, '', 'sig.jpeg', NULL, '2023-02-21 17:48:37', '2023-02-21 17:48:37');
